import React from "react";
import '../App.css';
import CreateRace from './CreateRace';
import SingUp from './SingUp';
import Login from './Login';
import AddCircuit from "./AddCircuit";
const [isLoggedIn, setIsLoggedIn] = useState(false)

        async function checkLoggedIn() {
            let restURL = "http://localhost:8081/race/rest/users/isLoggedIn";
            await fetch(restURL, {
                method: "GET",
                credentials: 'include',
                headers: {
                    mode: 'no-cors',
                    'Content-Type': 'application/json',
                }
            })
                .then(response => {
                    return response.json()
                })
                .then(data => {
                    setIsLoggedIn(data);
                })
        }
        useEffect(() => {
            checkLoggedIn();
        }, [])
function Home() {
  return (
      <div className="Home">
          <Login/>
          <CreateRace/>
          <SingUp/>
          <AddCircuit/>
      </div>
  );
}

export default Home;
